  "Fluent_run_more_info_text": {
    "us": "Fluent run limits the number of times the robot makes sharp turns, which reduces its tendency to get stuck in smooth and muddy conditions. The draw back by Fluent run is that it requires more space around the field. In some cases up to %1s.",
    "en": "Fluent run limits the number of times the robot makes sharp turns, which reduces its tendency to get stuck in smooth and muddy conditions. The draw back by Fluent run is that it requires more space around the pitch. In some cases up to %1s.",
    "da": "Kontinuert kørsel begrænser hvor mange gange robotten laver skarpe sving og gør dermed robotten bedre til at køre i glat og mudret føre. Ulempen ved kontinuert kørsel er at det kræver mere plads omkring banen. I nogle tilfælde op til %1s.",
    "se": "Fluent run begränsar antalet gånger som roboten gör tvära svängar, vilket minskar tendensen att fastna under hala och leriga omständigheter. Nackdelen med Fluent run är att det krävs mer utrymme runt planen. I vissa fall upp till %1s.",
    "de": "Mit Fluent Run fährt der Roboter weniger scharfe Kurven und bleibt so auf glattem oder schlammigem Untergrund weniger oft stecken. Der Nachteil von Fluent Run ist der erhöhte Platzbedarf um das Feld herum, in manchen Fällen bis zu %1s.",
    "nl": "Fluent Run beperkt het aantal keren dat de robot scherpe bochten maakt, waardoor hij minder geneigd is om vast te geraken in gladde en modderige omstandigheden. Het nadeel van Fluent Run is dat er meer ruimte rond het veld nodig is. In sommige gevallen tot wel %1s.",
    "fr": "Le parcours simple limite le nombre de fois où le robot effectue des virages serrés, ce qui réduit sa tendance à rester coincé dans des terrains souples et boueux. Le recul en cas de parcours simple signifie qu’il nécessite plus d’espace autour du terrain. Dans certains cas, jusqu’à %1s.",
    "it": "‏L'esecuzione fluida limita il numero di curve strette eseguite dal robot, evitando che resti bloccato in condizioni levigate e fangose. Lo svantaggio dell'esecuzione fluida è che richiede più spazio intorno al campo. In alcuni casi fino a %1s.",
    "es": "El desplazamiento fluido limita el número de veces en que el robot realiza giros bruscos, lo que reduce su tendencia a quedarse atascado en suelos uniformes y embarrados. El inconveniente es que el desplazamiento fluido requiere más espacio alrededor del campo. En algunos casos, hasta %1s.",
    "jp": "快速モードはロボットの急転回の回数を制限 し、滑りやすいまたは泥が深い条件による走行障害を低減します。 快速モードの欠点は、フィールド 周囲に最大で%1sの余裕が必要となることです。",
    "cn": "流畅运行限制机器人的急转弯次数，从而 减轻在平整和泥泞状况下卡住的倾向。流畅运行的 缺点是它需要更多的场地空间。有些情况下 高达 %1s。"
  },
